const { Title } = Typography;

class Devis extends React.Component{

    constructor(){
        super();
        this.state = {
            jsonDevis:{}
        }
    }

    componentWillMount(){
     fetch("https://api.travauxlib.com/api/devis-pro/JKusHl8Ba8MABIjdCtLZOe2lxxnUfX")
    .then(response=>response.json())
    .then(data=>this.setState({jsonDevis:data}))


    }

    render(){
        const Itle = <Title>{this.state.jsonDevis['title']}</Title>

const Essai= ()=>(<Descriptions title={"compagny"}>
<Descriptions.Item label={"name"}>{this.state.jsonDevis['compagny'].name}</Descriptions.Item>
<Descriptions.Item label="Telephone">1810000000</Descriptions.Item>
<Descriptions.Item label="Live">Hangzhou, Zhejiang</Descriptions.Item>
<Descriptions.Item label="Remark">empty</Descriptions.Item>
<Descriptions.Item label="Address">
  No. 18, Wantang Road, Xihu District, Hangzhou, Zhejiang, China
</Descriptions.Item>
</Descriptions>);
        return (<>
        <Itle/>
        <Essai/>
        </>)
    }
}

export default Devis;
